sparql:
SELECT DISTINCT ?uri ?createur ?createurLabel ?image ?titre_fr WHERE {
  {
    SELECT DISTINCT ?uri ?createur ?createurLabel ?image ?itemFrLabel WHERE {
      VALUES ?createur {
        wd:Q170259 
      }
      ?uri wdt:P31 wd:Q3305213;
        wdt:P170 ?createur;
        wdt:P18 ?image.
      ?createur rdfs:label ?createurLabel.
      FILTER((LANG(?createurLabel)) = "fr")
      BIND(?uri AS ?itemFr)
      SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],fr,en". }
    }
  }
  BIND(?itemFrLabel AS ?titre_fr)
}
